import React from 'react';

const Menu = ({ onToggle }) => {
  return (
    <div>
      <button onClick={() => onToggle('listagem')}>Listagem de Clientes</button>
      <button onClick={() => onToggle('cadastro')}>Cadastro de Clientes</button>
    </div>
  );
};

export default Menu;
